import React from 'react';
import { Switch, Route } from 'react-router-dom';

import ViewType from '../ViewType/ViewType';
import ContEditWindow from '../EditWindow/ContEditWindow';
import Home from '../Home/Home';
import Header from './Header';

const Main = () => (
  <main>
    <Switch>
        <Route exact path='/' component={Home}/>
        <Route path='/ViewType' component={ViewType}/>
        <Route path='/ViewType/ContEditWindow' component={ContEditWindow}/>

    </Switch>
  </main>
)
export default Main
